import React from "react";
import './styles.css';

const About=()=>{
    return (
        <div class="about">
            <div class="about-me-content">
                <div class="about-img"><img class="about-img" src="IMG_5405.JPG" alt="Gallery Image 1"/></div>
                <h1 className="about-header">Who I Am</h1>
                <p className="about-bio">I am currently a senior at Boston University and majoring in Computer Science.</p>
                <a href="/path/to/resume.pdf" class="download-button" download>Download Resume</a>
            </div>
            <div class="photo-gallery">
                <div class="gallery-item"><img src="2017.jpg" alt="Gallery Image 1"/></div>
                <div class="gallery-item"><img src="IMG_2067.JPG" alt="Gallery Image 2"/></div>
                <div class="gallery-item"><img src="IMG_0375.jpeg" alt="Gallery Image 3"/></div>
                <div class="gallery-item"><img src="IMG_5090.jpeg" alt="Gallery Image 4"/></div>
                <div class="gallery-item"><img src="IMG_0246.jpeg" alt="Gallery Image 6"/></div>
                <div class="gallery-item"><img src="IMG_6984.JPG" alt="Gallery Image 6"/></div>
            </div>
        </div>
    )
}

export default About;
